import React from 'react';
import LoginAdmin from './components/LoginAdmin';

function App() {
  return (
    <Router>
      <Routes>
        {/* Default route */}
        <Route path="/" element={<LoginAdmin />} />

        {/* Dashboard route */}
        <Route path="/dashboard" element={<Dashboard />} />

        {/* Redirect any unknown route to login */}
      </Routes>
    </Router>
  );
}

export default App;
